  false,\n\t\"url\": null,\n\t\"notes\": \"The original distribution of sea otters,
  Enhydra lutris (L), included the coastal area of the North Pacific Ocean and Bering
  Sea from Kamchatka south to Hokkaido Island, eastward to the Commander, Aleutian,
  and Pribilof Islands, and the North American coast from the Alaska Peninsula to
  southern California. The exploitation of sea otters, which was begun in 1742 by
  the survivors of the Bering Expedition, ended 170 years later with the extinction
  of the sea otter throughout most of its former range.\",\n\t\"license_title\": \"License
